import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Navbar from './components/Navbar';
import Hero from './components/Hero';
import DataSection from './components/DataSection';
import About from './components/About';
import Resources from './components/Resources';
import Footer from './components/Footer';
import LightSection1 from './components/LightSection1';
import LightSection2 from './components/LightSection2';
import LightSection3 from './components/LightSection3';
import LightSection4 from './components/LightSection4';
import TodoSum from './components/TodoSum';
import DataResources from './components/DataResources';
import DataOptions from './components/DataOptions';
import DataMaturity from './components/DataMaturity';
import DataProducts from './components/DataProducts';
import Fitopia from './components/Fitopia';
import PhytoplanktonExploration from './components/PhytoplanktonExploration';
import Tutorials from './components/Tutorials';
import Chlorophyll from './components/Chlorophyll';
import BuildInstructions from './components/BuildInstructions';
import OceanEcology from './components/OceanEcology';
import LatestNews from './components/LatestNews';
import StoryMaps from './components/StoryMaps';
import Brochures from './components/Brochures';
import MediaGallery from './components/MediaGallery';

function App() {
  return (
    <Router>
      <Navbar />
      <Routes>
        <Route path="/" element={<Hero />} />
        <Route path="/about" element={<About />} />
        <Route path="/data" element={<DataSection />} />
        <Route path="/resources" element={<Resources />} />
        <Route path="/light-section1" element={<LightSection1 />} />
        <Route path="/light-section2" element={<LightSection2 />} />
        <Route path="/light-section3" element={<LightSection3 />} />
        <Route path="/light-section4" element={<LightSection4 />} />
        <Route path="/todo-suma" element={<TodoSum />} />
        <Route path="/data-resources" element={<DataResources />} />
        <Route path="/data-options" element={<DataOptions />} />
        <Route path="/data-maturity" element={<DataMaturity />} />
        <Route path="/data-products" element={<DataProducts />} />
        <Route path="/fitopia" element={<Fitopia />} />
        <Route path="/phytoplankton-exploration" element={<PhytoplanktonExploration />} />
        <Route path="/tutorials" element={<Tutorials />} />
        <Route path="/chlorophyll" element={<Chlorophyll />} />
        <Route path="/build-instructions" element={<BuildInstructions />} />
        <Route path="/ocean-ecology" element={<OceanEcology />} />
        <Route path="/lastest-news" ele ment={<News />} />
        <Route path="/story-maps" element={<StoryMaps />} />
        <Route path="/brochures" element={<Brochures />} />
        <Route path="/media-gallery" element={<MediaGallery />} />
      </Routes>
      <Footer />
    </Router>
  );
}

export default App;
